HTML5 and CSS3 Develop with Tomorrows Standards Today.pdf

HTML5 and CSS3 are the future of web development, but you dont have to wait to start using them. Even though the specification is still in development, many modern browsers and mobile devices already support HTML5 and CSS3. This book gets you up to speed on the new HTML5 elements and CSS3 features you can use right now, and backwards compatible solutions ensure that you don't leave users of older browsers behind.

